import React from "react";

const ObservePage = ({ authUser }) => {
  return (
    <div className="flex flex-col items-center justify-center text-center text-white py-10 min-h-screen">
      <div className="hero-section">
        <div>
          <h1 className="display-3 fw-bold">Observing Program</h1>
          <p>Discover the future with our cutting-edge platform.</p>
        </div>
      </div>
    </div>
  );
};

export default ObservePage;
